### JavaScript

```javascript
"use strict";

function f_gold(n) {
    let v = 1;
    let ans = [];
    for (let i = 0; i < n; i++) {
        ans.push(v);
        if (v * 10 <= n) {
            v *= 10;
        } else {
            while (v % 10 === 9 || v + 1 > n) {
                v = Math.floor(v / 10);
            }
            v += 1;
        }
    }
    return ans;
}
